import React, { useState, useEffect } from 'react';
import axios from 'axios';

export default function Client() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:4000/ConsaltantHome')
      .then(response => {
        console.log(response.data); // Verilerin doğru gelip gelmediğini kontrol etmek için
        setUsers(response.data);
      })
      .catch(err => console.log(err));
  }, []);

  return (
    <>
      Hears Consultant Page
      {users.map(user => (
      <div style={{display:'flex',flexDirection:'row' , alignItems:'center', justifyContent:'center'}}>
      <p style={{alignItems:'center', justifyContent:'center',padding:10}}key={user.id}>{user.name}</p>
      
      <button > DANIŞ</button>

      </div>
      
      ))}
    </>
  );
}
